import React, {useState} from 'react';
import {Box, Grid, Card, CardActionArea, CardActions, CardContent, CardMedia, Button, Typography} from '@material-ui/core' 
import {makeStyles} from '@material-ui/core/styles'
import Navbar from '../navbar/navbar'

const useStyles = makeStyles((theme) => ({
    mainContainer: {
        backgroundColor: 'white',
        height: '100%',
        paddingTop: '2rem'
    },
    headerContainer: {
        textAlign: 'center',
        fontSize: '0.2rem',
        textTransform: 'uppercase'
    },
    mainContent: {
        padding: '1rem 10%'
    }
}))

const Intranet = (props) => {
    const classes = useStyles();
    return (
        <>
            <Navbar/>
            <Box component='div' className={classes.mainContainer}>
                <Box component='header' className={classes.headerContainer}>
                    <Typography variant='h4'>Welcome to the Intranet</Typography>
                </Box>
                <Box component='div' className={classes.mainContent}>
                    <Grid item lg={5} spacing={2}>
                        <Typography variant='h5'>Team 1</Typography>
                    </Grid>
                </Box>
            </Box>
        </>
    )
}

export default Intranet
